import React from 'react';
import logo from './logo.svg';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from 'react-router-dom';
import {
  Col,
  Container,
  Row
} from 'react-bootstrap';


function Home() {
  return (
    <Container>
      <Row>
        <Col><h2>Home</h2></Col>
      </Row>
    </Container>
  )
}

function CreateLobby() {
  return (
    <Container>
      <Row>
        <Col><h2>CreateLobby</h2></Col>
      </Row>
    </Container>
  )
}

function Lobby() {
  return (
    <Container>
      <Row>
        <Col><h2>Lobby</h2></Col>
      </Row>
    </Container>
  )
}

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/create-lobby">
          <CreateLobby />
        </Route>
        <Route path="/lobby">
          <Lobby />
        </Route>
        <Route path="/">
          <Home />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
